(00000000105, 'GT0221', 'DCI Has been signed <br>\r\n\r\nProcurement confirm<br>\r\n1. Kami telah issue revisi PO. 610629 dari qty. 2,500 pcs menjadi 1,860 pcs untuk clear Satonagatomi Old stock.<br> \r\n2. Delivery point no. 1 => 21 July (today) telah diberi label merah old spec. <br>\r\n3. Unit price dan MOQ ZG05390 tetap, jadi no need update CAF. <br>\r\n4. New spec after DCI GT-0221 telah kami open order under PO. NA1607014 qty. 2,000 pcs dengan due date ETA YEMI 12 Aug. (Include transfer PO). <br>\r\n5. DCI ini effective ASAP. Dan berdasar table diatas, maka Running change will be on Nov 2016 (use new spec after DCI). <br>\r\n6. Atau bila point 5 change to Must September 2016, Dead stock will be => IDR 1,318 x 6,596 => IDR 8,693,528 (USD 655.4228)<br>\r\n\r\n', 'CLOSE', 'APPROVE-DCI GT-0221 -ZG05390.pdf', './files/purch/APPROVE-DCI GT-0221 -ZG05390.pdf'),
